.people-container {
  padding: 10px 30px;
  height: 1000px;
}
.demo-form-inline {
  margin-top: 20px;
}
.el-table {
  border: 1px solid #dfe6ec;
  border-radius: 8px;
}
.form {
  width: 100%;
  display: flex;
  // flex-direction: column;
  padding: 10px;

  &-l {
    flex: 1;
    padding-right: 40px;
  }
  &-r {
    flex: 1;
  }
}

.avatar-uploader .el-upload {
  border: 1px dashed #d9d9d9;
  border-radius: 6px;
  cursor: pointer;
  position: relative;
  overflow: hidden;
}
.avatar-uploader .el-upload:hover {
  border-color: #409eff;
}
.avatar-uploader-icon {
  font-size: 28px;
  color: #8c939d;
  width: 112px;
  height: 160px;
  line-height: 160px;
  text-align: center;
  border: 1px solid #8c939d;
}
.avatar {
  width: 112px;
  height: 160px;
  display: block;
}
.page {
  width: 100%;
  margin-top: 10px;
  position: relative;
  .el-pagination {
    position: absolute;
    right: 10px;
  }
}
